  useEffect(() => {
    console.log(localStorage.getItem('userName'));
  });

  return (
    <nav>
      <div className="logo">
        <Link to='/'>
          <h4>Logo</h4> 
        </Link>
      </div>
      <div className="name">
        <h4 id='user'></h4>
      </div>
    </nav>
  )
}

export default Nav;
